Ich habe Twisted Fate ge&uuml;bt als mir dieser Tooltip bug aufgefallen ist. Danach bin ich erneut in ein custom Game gegengen und es hat angezeigt: 
&quot;-3000% for 0 seconds&quot; . au&szlig;erdem ist mir aufgefallen das bei Twisted Fates E &quot;In addition, his Attack Speed is increased by 1000%&quot; angezeigt wird. Beide Zahlen erh&ouml;hen sich mit der Sture der F&auml;higkeit. Auf: 
W: &quot;-5000&amp; for 0 Seconds&quot;
E: &quot;increased by 3000%&quot;
